const Sum = function(a) {
    let c = 0;

    for (let i = 0; i < a.length; i++) {
        c = c + a[i];
    };

    return c;
};

const Mul = function(x, w) {
    let c = [];

    for (let i = 0; i < x.length; i++) {
        c[i] = x[i] * w[i];
    };

    return c;
};

const Dot = function(x, w) {
    let c = [];
    
    for (let i = 0; i < w.length; i++) {
        c[i] = Sum(Mul(x, w[i]));
    };

    return c;
};

const ReLU = function(a) {
    let c = [];
    
    for (let i = 0; i < a.length; i++) {
        c[i] = Math.max(a[i], 0);
    };

    return c;
};

const Softsign = function(a) {
    let c = [];
    
    for (let i = 0; i < a.length; i++) {
        c[i] = a[i] / (1 + Math.abs(a[i]));
    };

    return c;
};

const StrToList = function(str) {
    let [fen, tour] = str.split(" ").slice(0, 2);
    fen = fen.replace(/\//gi, "")
        .replace(/1/gi, ".")
        .replace(/2/gi, "..")
        .replace(/3/gi, "...")
        .replace(/4/gi, "....")
        .replace(/5/gi, ".....")
        .replace(/6/gi, "......")
        .replace(/7/gi, ".......")
        .replace(/8/gi, "........");
    let hot = Array(770).fill(0);

    for (let idx = 0; idx < fen.length; idx++) {
        switch (fen[idx]) {
            case "r":
                hot[idx*12 +  0] = 1;
                continue;
            case "n":
                hot[idx*12 +  1] = 1;
                continue;
            case "b": 
                hot[idx*12 +  2] = 1;
                continue;
            case "q":
                hot[idx*12 +  3] = 1;
                continue;
            case "k":
                hot[idx*12 +  4] = 1;
                continue;
            case "p":
                hot[idx*12 +  5] = 1;
                continue;
            case "R":
                hot[idx*12 +  6] = 1;
                continue;
            case "N":
                hot[idx*12 +  7] = 1;
                continue;
            case "B":
                hot[idx*12 +  8] = 1;
                continue;
            case "Q":
                hot[idx*12 +  9] = 1;
                continue;
            case "K":
                hot[idx*12 + 10] = 1;
                continue;
            case "P":
                hot[idx*12 + 11] = 1;
                continue;
            case ".":
                continue;
        }
    }

    if (tour === "b") {
        hot[768] = 1;
    } else {
        hot[769] = 1;
    }

    return hot;
};

const Bot = function(x) {
    let inp, out;
    inp = StrToList(x);
    out = Dot(inp, weight.hot);
    out = ReLU(Dot(out, weight.linear1));
    out = ReLU(Dot(out, weight.linear2));
    out = Softsign(Dot(out, weight.linear3));

    return out[0];
};


